import{_ as t,c as n,o,ag as r}from"./chunks/framework.By5zrZ8k.js";const u=JSON.parse('{"title":"Neo Core Release Notes","description":"","frontmatter":{},"headers":[],"relativePath":"projects/neo/core/rn-core.md","filePath":"projects/neo/core/rn-core.md","lastUpdated":1767691233000}'),a={name:"projects/neo/core/rn-core.md"};function i(s,e,l,c,d,g){return o(),n("div",null,[...e[0]||(e[0]=[r('<h1 id="neo-core-release-notes" tabindex="-1">Neo Core Release Notes <a class="header-anchor" href="#neo-core-release-notes" aria-label="Permalink to &quot;Neo Core Release Notes&quot;">​</a></h1><p>Neo Core is the container service responsible for the extraction and API operations of the service.</p><h2 id="current-version" tabindex="-1">Current Version <a class="header-anchor" href="#current-version" aria-label="Permalink to &quot;Current Version&quot;">​</a></h2><h3 id="_3-1-0-released-9th-december-2025" tabindex="-1">3.1.0 (Released 9th December 2025) <a class="header-anchor" href="#_3-1-0-released-9th-december-2025" aria-label="Permalink to &quot;3.1.0 (Released 9th December 2025)&quot;">​</a></h3><ul><li><strong>New</strong>: FTE Search capabilities (new /search endpoint for agentic AI).</li><li><strong>New</strong>: Named Entity Recognition, Classification and Structured Data Extraction and Relation Extraction.</li><li><strong>Enhancement</strong>: Customers migrating from v3.0.5 or lower with pre-configured environmental variables will now experience automatic environment variable migration during setup mode and setup will be marked as complete.</li><li><strong>Enhancement</strong>: ACL resolution will now work in a greater variety of auth/security environments.</li><li><strong>Fix</strong>: Better detection of stale http transport to Graph API to prevent Graph Client Error: &quot;HTTP transport has already been closed&quot;.</li><li><strong>Fix</strong>: Graph connector ID changes via hot-reload now correctly register new connectors in Microsoft 365.</li><li><strong>Fix</strong>: Changing the MS_GRAPH_CONNECTOR_ID no longer resets the CONNECTOR_ID used for licensing. This prevents license mismatch scenarios.</li></ul><h3 id="_3-0-5-released-28th-november-2025" tabindex="-1">3.0.5 (Released 28th November 2025) <a class="header-anchor" href="#_3-0-5-released-28th-november-2025" aria-label="Permalink to &quot;3.0.5 (Released 28th November 2025)&quot;">​</a></h3><ul><li><strong>New</strong> Neo search for agentic workflows is here (supports both PostgreSQL and MySQL databases). This returns the most relevant documents and content for agentic workflows from a query interface.</li><li><strong>New:</strong> Stateless container deployment - no environmental variables required to deploy the connector - (backward compatibility).</li><li><strong>New:</strong> Neo is now manageable via web interface (Note: desktop client is now no longer maintained).</li><li><strong>Enhancement:</strong> Threads are now dynamically calculated on start-up, providing optimal scaling and memory management. This provides significant performance enhancement for tasks, especially when more CPUs are available.</li><li><strong>Enhancement:</strong> The connector is now fully responsive, even during long running extraction tasks that would previously lock the task queue.</li><li><strong>Enhancement:</strong> Filters/Rules - Added a rolling window i.e. last 12 months to the date filters.</li><li><strong>Enhancement:</strong> One-time password retrieval via API: <ul><li>Only active if admin has never logged in before</li><li>Disables once admin has logged in at least once</li></ul></li><li><strong>Enhancement:</strong> Uninstall NetApp Neo API <ul><li>Clear database to clean state</li><li>Remove connector from M365 Connectors (this automatically removes all items from M365 Graph)</li></ul></li><li><strong>Enhancement:</strong> Neo no longer automatically attempts to continue an interrupted crawl upon reboot. Instead it will await the next scheduled crawl.</li><li><strong>Fix:</strong> Build date was not reflected correctly.</li></ul><h2 id="version-history" tabindex="-1">Version History <a class="header-anchor" href="#version-history" aria-label="Permalink to &quot;Version History&quot;">​</a></h2><h3 id="_3-0-4-released-22nd-october-2025" tabindex="-1">3.0.4 (Released 22nd October 2025) <a class="header-anchor" href="#_3-0-4-released-22nd-october-2025" aria-label="Permalink to &quot;3.0.4 (Released 22nd October 2025)&quot;">​</a></h3><ul><li><strong>Enhancement:</strong> Enhance use_client behavior for graph service client</li><li><strong>Enhancement:</strong> Management API responsiveness during long-running operations</li><li><strong>Enhancement:</strong> Newly implemented task scheduler allows cancellation and monitoring of all task operations</li><li><strong>Enhancement:</strong> Can view current performance metrics of all running tasks and estimate time to completion</li><li><strong>Enhancement:</strong> Reporting of share READY state has been restored to previous behaviour</li><li><strong>Enhancement:</strong> Allow pre-loading of document extraction models</li><li><strong>Enhancement:</strong> Helm chart now includes: <ul><li>Optional database deployment (PostgreSQL)</li></ul></li><li><strong>Sizing Guidance</strong>: <ul><li>15m per week ingest to Microsoft Graph<br> - 2.1m items per day (100% utilization)</li></ul></li><li><strong>Fix:</strong> Certain operation types not being reflected in database</li></ul><h3 id="_2-2-6-released-22nd-october-2025" tabindex="-1">2.2.6 (Released 22nd October 2025) <a class="header-anchor" href="#_2-2-6-released-22nd-october-2025" aria-label="Permalink to &quot;2.2.6 (Released 22nd October 2025)&quot;">​</a></h3><ul><li><strong>Enhancement:</strong> SID ACL Resolution</li><li><strong>Enhancement:</strong> Graph HTTP Client Handling (for intermittent connectivity issues)</li><li><strong>Fix:</strong> Implement users API endpoint</li><li>Note: This will be the last 2.x.x release. It is recommended to use the 3.x.x releases moving forward.</li></ul><h3 id="_3-0-3-released-10th-october-2025" tabindex="-1">3.0.3 (Released 10th October 2025) <a class="header-anchor" href="#_3-0-3-released-10th-october-2025" aria-label="Permalink to &quot;3.0.3 (Released 10th October 2025)&quot;">​</a></h3><ul><li><strong>Enhancement:</strong> Remove requirement for persistent storage for containers. All container configuration is now stored in database storage providing the following benefits: <ul><li>✅ <strong>Automatic key sharing</strong> - All nodes read from same database</li><li>✅ <strong>Easy scaling</strong> - New nodes automatically get keys on start up</li><li>✅ <strong>Centralized management</strong> - Update keys in one place</li><li>✅ <strong>Audit trail</strong> - Track when keys are accessed/updated</li><li>✅ <strong>No volume required</strong> - Truly stateless containers</li><li>✅ <strong>High availability</strong> - Database replication handles redundancy</li></ul></li><li><strong>Enhancement:</strong> Added graceful shutdown handling of claimed work items (immediately release items - previously these would be handled by timeout (5 mins)</li><li><strong>Enhancement:</strong> Implement Graph connector leader election logic</li><li><strong>Enhancement:</strong> Helm chart now includes: <ul><li>Ingress configuration</li><li>Optional database-to-go (PostgreSQL / MySQL)</li></ul></li><li><strong>Enhancement:</strong> User ACL resolution (Users are not resolving)</li><li><strong>Fix:</strong> files after initial scan (modified) or added were not being extracted</li><li>Change <strong>link</strong> to <strong>url</strong> to allow direct click through on Copilot results tiles.</li></ul><h3 id="_2-2-5-released-8th-october-2025" tabindex="-1">2.2.5 : (Released 8th October 2025) <a class="header-anchor" href="#_2-2-5-released-8th-october-2025" aria-label="Permalink to &quot;2.2.5 : (Released 8th October 2025)&quot;">​</a></h3><ul><li><strong>Fix:</strong> items were not being uploaded to MS Graph in certain scenarios</li><li><strong>Fix:</strong> ACL extraction</li><li><strong>Important Note</strong>: The 2.x.x code line is the last series to support internal database. As of 3.x.x an external database (<strong>postgres/mysql</strong>) is required for the connector</li></ul><h3 id="_3-0-2-released-7th-october-2025" tabindex="-1">3.0.2 : (Released 7th October 2025) <a class="header-anchor" href="#_3-0-2-released-7th-october-2025" aria-label="Permalink to &quot;3.0.2 : (Released 7th October 2025)&quot;">​</a></h3><ul><li><strong>Fix:</strong> Stale share status if connector is interrupted during a prior run</li><li><strong>Fix:</strong> Changed file detection - in certain scenarios the connector incorrectly identified unchanged files as changes resulting in unnecessary extraction on those files</li></ul>',18)])])}const m=t(a,[["render",i]]);export{u as __pageData,m as default};
